description:
Julie, 30 ans, la standardiste (NEW 2014 La banane prod) [WebDL]

Julie Valmont, Pascal St James, Ricky Mancini, Fabrice Triple X, Juliana Lust, Kim Liberty, Natacha Guapa

Julie, 30 ans, est l'affut de tous les ragots et de la moindre histoire de cul concernant ses collgues...
Son poste de standardiste lui permet d'tre au courant de la moindre coucherie au sein de l'entreprise.
Cette petite salope en profite pour prendre la moindre bite qui traine...

